import React from "react";
import { NavLink } from "react-router-dom";
import styled from "styled-components";
import { Button } from "./components/Button";
import GoogleIcon from "@mui/icons-material/Google";
import FacebookOutlinedIcon from "@mui/icons-material/FacebookOutlined";
import TwitterIcon from "@mui/icons-material/Twitter";
const Footer = () => {
    return (
        <>
            <Wrapper>
                <div className="container">
                    <div className="box">
                        <div className="box_content">
                            <p>Best Grocery Products Here</p>
                            <NavLink to="./contact">
                                <Button>Order Now</Button>
                            </NavLink>
                        </div>
                    </div>
                </div>
                <div className="footer_portion">
                    <div className="container">
                        <div className="grid grid-four-column">
                            <div className="grid-two-rows">
                                <h3>grocery store🛒</h3>
                                <p>The best online grocery store in India.</p>
                            </div>
                            <div className="grid-two-rows">
                              <img class="cart_image" src="./images/cart_img.png"/>
                            </div>
                            <div className="grid-two-rows">
                                <h3>follow us</h3>
                                <div className="icons">
                                    <GoogleIcon className="icon" />
                                    <FacebookOutlinedIcon className="icon" />
                                    <TwitterIcon className="icon" />
                                </div>
                            </div>
                            <div className="grid-two-rows">
                                <h3>contact us:</h3>
                                <a href="tel:+918755231772">+918755231772</a>
                                <h3>EmailID:</h3>
                                <p>kajal@gmail.com</p>
                            </div>
                        </div>
                    </div>
                    <hr className="footer_hr" />
                    <div className="container hr_bottom grid-two-colums">
                        <div className="grid-two-rows">
                            <p>©️2022 Grocery Store.All Rights Reserved</p>
                        </div>
                        <div className="grid-two-rows">
                            <p>PRIVACY POLICY</p>
                            <p>TERMS & CONDITION</p>
                        </div>
                    </div>
                </div>
            </Wrapper>
        </>
    );
};
const Wrapper = styled.section`
margin-top:9rem;
.container{
    .box{
    background: ${({ theme }) => theme.colors.bg};
    width:80rem;
    height:7rem;
    position:absolute;
    top:128rem;
    left:21%;
    z-index:4;
    .box_content{
        display:flex;
        align-items:center;
        justify-content:space-between;
        margin:0 4rem;
    }
}
}
  .footer_portion {
    position:relative;
    z-index:-2;
    padding:1rem 0 7rem 0;
    background: ${({ theme }) => theme.colors.text};
    color: white;
    .container {

      text-transform: capitalize;
      line-height: 3.4rem;
      .grid-four-column {
        .grid-two-rows {
          h3 {
            font-size: 1.7rem;
          }
          a{
            text-decoration:none;
            list-style:none;
            color: white;
            font-size: 1.4rem;
          }
          p {
            color: white;
            font-size: 1.4rem;
            line-height: 1.5rem;
          }
          img{
            color:red;
            font-size:30rem;
            .cart-image{
                font-size:30rem;
            }
          }
          .icons {
            padding: 0.1rem;

            .icon {
              border: 1px solid white;
              margin-left: 0.6rem;
              border-radius: 50%;
              font-size: 1.7rem;
            }
          }
          .footer_btn{
            padding:0.3rem 1rem;
          }
        }
      }
    }
    .footer_hr{
        color:${({ theme }) => theme.colors.bg};
        height:.01rem;
        margin:3rem 0;

    }
    .hr_bottom{
        display:flex;
        align-items:center;
        justify-content:space-around; 

        p{
            color:white;
            font-size: 1.2rem;
        }
    }
  }
`;
export default Footer;
